import styled from 'styled-components';

export const NavBar = styled.nav`
  height: 72px;
  width: 1000px;
  /* max-width:100%; */
  margin: 0 auto;
  display: flex;
  justify-content: space-between;
  background: blue;
  align-items: center;
  .navbar-items {
    display: flex;
  }
`;
